description:
All-New Official Handbook of the Marvel Universe A-Z 01-12 (2006-2007|Reu+Team-DCP)

Promotional info - &quot;The most exciting and comprehensive Marvel handbook is fi nally here! Beginning a twelve-volume guide to the Marvel Universe with more than 100 huge entries in each tome!&quot;

This is the revised and expanded edition of the Handbook with major updates to the material from the original publication (which was a 15-issue series starting in 1983). All issues are by Reu-DCP except one by Team-DCP proper. Credit is listing in the individual titles. Thanks to the DCP scanners for their efforts, please seed and enjoy! :-)
